import React from "react";
import {Nav, NavDropdown, Form, Button, Navbar, Container} from 'react-bootstrap';
import { Link } from "react-router-dom";
import "./AppBar.css"


const AppBar = (props) => {

    const menu = (
        <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="mr-auto">
                    <Nav.Link style={{marginLeft: 20}}/>
                </Nav>
                <Nav variant={"right"} >
                    <Nav.Item bsPrefix={'nav-link'}><Link to={"/deals/"}>Сделки</Link></Nav.Item>
                    <Nav.Item bsPrefix={'nav-link'}><Link to={"/events/"}>Мероприятия</Link></Nav.Item>
                    <Nav.Item bsPrefix={'nav-link'}><Link to={"/services/"}>Услуги</Link></Nav.Item>
                    <Nav.Item bsPrefix={'nav-link'}><Link to={"/suppliers/"}>Поставщики</Link></Nav.Item>
                    <Form inline>

                </Form>
                  <NavDropdown title="Account" id="basic-nav-dropdown" alignRight>
                    <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                    <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
                    <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                    <NavDropdown.Divider />
                    <NavDropdown.Item onClick={ props.onLogout }>Logout</NavDropdown.Item>
                  </NavDropdown>
                </Nav>

              </Navbar.Collapse>
    ) ;

    return (
        <Container fluid style={{backgroundColor: "#F0F0FF", paddingLeft: 20, paddingRight:40}}>
            <Navbar style={{textColor: "#000000", paddingLeft: 20, paddingRight:40, }}>
                <Navbar.Brand href="/"><strong>Eventplan</strong></Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />

                { menu }

            </Navbar>
        </Container>
            )

}


export default AppBar;
